// SPDX-License-Identifier: Unlicensed
pragma solidity  ^0.8.0;


library Poke {

    enum Ball {
        POKE,
        GREAT,
        ULTRA,
        SAFARI,
        MASTER
    }
}

library Strings {
    bytes16 private constant _HEX_SYMBOLS = "0123456789abcdef";

    // via https://github.com/oraclize/ethereum-api/blob/master/oraclizeAPI_0.5.sol
    function strConcat(
        string memory _a,
        string memory _b,
        string memory _c,
        string memory _d,
        string memory _e
    ) internal pure returns(string memory) {
        bytes memory _ba = bytes(_a);
        bytes memory _bb = bytes(_b);
        bytes memory _bc = bytes(_c);
        bytes memory _bd = bytes(_d);
        bytes memory _be = bytes(_e);
        string memory abcde = new string(
            _ba.length + _bb.length + _bc.length + _bd.length + _be.length
        );
        bytes memory babcde = bytes(abcde);
        uint256 k = 0;
        for (uint256 i = 0; i < _ba.length; i++) babcde[k++] = _ba[i];
        for (uint256 i = 0; i < _bb.length; i++) babcde[k++] = _bb[i];
        for (uint256 i = 0; i < _bc.length; i++) babcde[k++] = _bc[i];
        for (uint256 i = 0; i < _bd.length; i++) babcde[k++] = _bd[i];
        for (uint256 i = 0; i < _be.length; i++) babcde[k++] = _be[i];
        return string(babcde);
    }

    function strConcat(string memory _a, string memory _b)
        internal
        pure
        returns(string memory)
    {
        return strConcat(_a, _b, "", "", "");
    }

    function toString(uint256 value) internal pure returns(string memory) {
        // Inspired by OraclizeAPI's implementation - MIT licence
        // https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol

        if(value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while(temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while(value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }



}

contracts/Pokeball.sol.content:
// SPDX-License-Identifier: Unlicensed
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC1155/extensions/ERC1155SupplyUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/structs/EnumerableSetUpgradeable.sol";
import "./libraries/Lib.sol";

contract Pokeball is ERC1155SupplyUpgradeable, OwnableUpgradeable {
    using EnumerableSetUpgradeable for EnumerableSetUpgradeable.AddressSet;

    EnumerableSetUpgradeable.AddressSet private _admins;

    mapping(uint256 => uint256) public caps;
    mapping(uint256 => uint256) public amountMinted;

    modifier onlyAdmin() {
        require(_admins.contains(_msgSender()), "Not Admin");
        _;
    }

    function initialize(string memory _uri) public initializer {
        __ERC1155_init_unchained(_uri);
        __ERC1155Supply_init_unchained();
        __Ownable_init();

        _admins.add(msg.sender);
    }

    //----------------------------ONWNER------------------------------------

    function addAdmin(address value) external onlyOwner {
        bool added = _admins.add(value);
        require(added, "Add admin not successfuly");
    }


    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function setCaps(
        uint256[] memory tokenIds,
        uint256[] memory values
    ) external onlyOwner {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            caps[tokenIds[i]] = values[i];
        }
    }

    //-------------------------------PUBLIC---------------------------------

    function getAdmin() public view returns (address[] memory) {
        return _admins.values();
    }

    function tokenURI(uint256 _id) public view returns (string memory) {
        return  Strings.strConcat(Strings.strConcat(uri(_id), Strings.toString(_id)), ".json");
    }

    //------------------------------ADMIN----------------------------------

    function mint(
        address user,
        Poke.Ball ballType,
        uint256 amount
    ) external onlyAdmin {
        _mint(user, uint256(ballType), amount, "");
    }

    function burn(
        address user,
        Poke.Ball ballType,
        uint256 amount
    ) external onlyAdmin {
        _burn(user, uint256(ballType), amount);
    }

    //-------------------------------INTERNAL---------------------------------
    function _beforeTokenTransfer(
        address operator,
        address from,
        address to,
        uint256[] memory ids,
        uint256[] memory amounts,
        bytes memory data
    ) internal virtual override {
        super._beforeTokenTransfer(operator, from, to, ids, amounts, data);

        if (from == address(0)) {
            for (uint256 i = 0; i < ids.length; ++i) {
                amountMinted[ids[i]] += amounts[i];
                require(amountMinted[ids[i]] <= caps[ids[i]], "Exceed caps");
            }
        }
    }
}

